import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class='inputform'>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h4>Welcome!</h4>
      </header>
      <div>
      <lable for="username" class="formtext">Username &nbsp;</lable>
      <input class="username" type="text" placeholder='Enter the username'></input>
      </div>
      <br></br>
      <div>
      <lable for="password" class="formtext">Password &nbsp;</lable>
      <input class="password" type="password" placeholder='Enter the Password'></input>
      </div>
      <button type='submit'>Login</button>
      <button type='submit'>Register</button>
      </div>
    </div>
  );
}

export default App;
